import api from "./api";

export default {
  createSession() {
    return api.get('http://localhost/sanctum/csrf-cookie');
  },

  login(params) {
    return api.post('http://localhost/api/login', params);
  },
  register(params) {
    return api.post('http://localhost/api/register',params);
  },
  logout() {
    return api.delete('http://localhost/api/logout');
  },

  getPosts() {
    return api.get(`http://localhost/api/userlist`);
  },
  getPost(id) {
    return api.get(`http://localhost/api/userlist/`+id);
  },
  setUpdate(id,params) {
    return api.put('http://localhost/api/userlist/'+id,params);
  },
  setDelete(id) {
    return api.delete('http://localhost/api/userlist/'+id);
  }
};
